import './App.css';
import Navbar from './components/Navbar'
import {Routes, Route, BrowserRouter as Router} from "react-router-dom";

function App() {
  return (
    <div className="App">
        <Router>
            <Navbar/>
           <Route></Route>
        </Router>
    </div>
  );
}

export default App;
